import React, { Component } from "react";

export default class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstname: "",
      lastname: "",
      email: "",
      password: "",
      password2: "",
      error: {}
    };
  }
  render() {
    return (
      <div>
        <h1>Register</h1>
        <form action="/action_page.php">
          First Name:
          <br />
          <input type="text" name="firstname" value={this.state.firstname} />
          <br />
          Last name:
          <br />
          <input type="text" name="lastname" value={this.state.lastname} />
          <br />
          Email:
          <br />
          <input type="text" name="firstname" value={this.state.email} />
          <br />
          Password:
          <br />
          <input type="text" name="firstname" value={this.state.password} />
          <br />
          Password Again:
          <br />
          <input type="text" name="firstname" value={this.state.password2} />
          <br />
          <br />
          <input type="submit" value="Submit" />
        </form>
      </div>
    );
  }
}
